import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './material-dashboard.css';
import BookList from './BookList';
import BookListView from './BookListView';
import AddBook from './AddBook';

const MainPage = () => {
    const [Books, setBooks] = useState([]);
    const [isActive, setIsActive] = useState(false);
    const [listActive, setListActive] = useState(false);
    const [addBookView, setAddBookView] = useState(false);
    const [addBookActive , setAddBookActive] = useState(false);
    const [showBookView, setShowBookView] = useState(false);
    const [showListView, setListView] = useState(false);

    useEffect(() => {
        // JSON dosyasını fetch et
        axios.get('./Books.json')
            .then(response => {
                setBooks(response.data);
            })
            .catch(error => {
                console.error("There was an error fetching the books!", error);
            });
    }, []);

    const handleLibraryClick = () => {
        setIsActive(!isActive);
        if(isActive){
            setListActive(false);
            setAddBookActive(false);
            setShowBookView(true);
        } else {
            setShowBookView(false);
        }
    };

    const handleListViewClick = () => {
        setListActive(!listActive);
        if(listActive){
            setListView(true);
            setAddBookActive(false);
            setShowBookView(false);
        } else {
            setListView(false);
        }
    };

    const handleAddBookClick = () => {
        setAddBookActive(!addBookActive);
        if(addBookActive){
            setAddBookView(true);
            setListView(false);
            setShowBookView(false);
        } else {
            setAddBookView(false);
        }
    }

    return(
        <div className="wrapper">
            <div className="sidebar" data-background-color="black" data-image="./assets/img/sidebar-2.jpg">
                <div className="logo">
                    <a className="simple-text logo-normal">
                        ShelfSync
                    </a>
                </div>
                <div className="sidebar-wrapper">
                    <ul className="nav">
                        <li className={`nav-link ${isActive ? 'nav-link.active' : ''}`}>
                            <a className="nav-link" href="#" onClick={handleLibraryClick}>
                                <i className="material-icons">library_books</i>
                                <p>Library</p>
                            </a>       
                        </li>
                        <li>
                            <a className="nav-link" href="javascript:void(2)" onClick={handleListViewClick}>
                                <i className="material-icons">format_list_bulleted</i>
                                <p>List View</p>
                            </a>
                        </li>
                        <li>
                            <a className="nav-link" href="javascript:void(2)" onClick={handleAddBookClick}>
                                <i className="material-icons">add</i>
                                <p>Add New</p>
                            </a>
                        </li>
                        <li>
                            <a className="nav-link" href="javascript:void(3)">
                                <i className="material-icons">person</i>
                                <p>Settings</p>
                            </a>
                        </li>
                        <li style={{listStyle: 'none', marginTop: '110%'}}>
                            <a className="nav-link" href="javascript:void(3)">
                                <i className="material-icons">logout</i>
                                <p>Logout</p>
                            </a>
                        </li>
                    </ul>
                </div>
            </div>
            <div className="main-panel">
                <nav className="navbar navbar-expand-lg navbar-transparent navbar-absolute fixed-top">
                    <div className="container-fluid">
                        <div className="navbar-wrapper">
                            <a className="navbar-brand" href="javascript:void(0)">Buy us a coffee</a>
                            <i className="material-icons">coffee</i>
                        </div>
                        <button className="navbar-toggler" type="button" data-toggle="collapse" aria-controls="navigation-index" aria-expanded="false" aria-label="Toggle navigation">
                            <span className="sr-only">Toggle navigation</span>
                            <span className="navbar-toggler-icon icon-bar"></span>
                            <span className="navbar-toggler-icon icon-bar"></span>
                            <span className="navbar-toggler-icon icon-bar"></span>
                        </button>
                        <div className="collapse navbar-collapse justify-content-end">
                            <ul className="navbar-nav">
                                <li className="nav-item">
                                    <a className="nav-link" href="javascript:void(0)">
                                        <p>asd</p>
                                        <i className="material-icons">person</i>
                                        <p className="d-lg-none d-md-block"></p>
                                    </a>
                                </li>
                            </ul>
                        </div>
                    </div>
                </nav>
                <div className="content">
                    <div className="container-fluid">
                        {showBookView ? <BookList books={Books} /> : ''}
                        {showListView ? <BookListView books={Books} /> : ''}
                        {addBookView ? <AddBook /> : ''}
                    </div>
                </div>
            </div>
        </div>
    );
};

export default MainPage;
